Обов*язково досвід розробки чат-ботів (кодове програмування);
На постійну співпрацю (оплата попроектна);
Основні функції, що потрібно вміти робити:

Інтеграцію чат боту з еmail -сервісами;
Розроблення адмін-панелі для збору та аналізу даних;
Інтеграція чат- боту з самописним сайтом та системами облі
